import React, { useState } from 'react';
import './SensorDemo.css';

function SensorDemo() {
    const [status, setStatus] = useState('');
    const [videoSrc, setVideoSrc] = useState(null);

    const handleImageUpload = (event) => {
        const file = event.target.files[0];
        const reader = new FileReader();

        reader.onloadend = () => {
            setVideoSrc(reader.result);
        };

        if (file) {
            reader.readAsDataURL(file);
        }
    };

    const handleButtonClick = (endpoint) => {
        fetch(endpoint, { method: 'POST' })
            .then(response => response.json())
            .then(data => setStatus('Variable toggled: ' + data.toggle_variable))
            .catch(error => console.error(error));
    };

    return (
        <div>
            <h1>
                <span><img src="image.png" height="30px" alt="logo" /></span>
                <span>&nbsp;RaspberryPi Sensor demo</span>
            </h1>

            <div>
                <div className="title">
                    <h2>Video Stream</h2>
                </div>
                <div className="box">
                    <div style={{ width: '40%', height: '500px' }}>
                        {videoSrc ? (
                            <video controls width="100%" height="500px">
                                <source src={videoSrc} type="video/mp4" />
                                Your browser does not support the video tag.
                            </video>
                        ) : (
                            <input type="file" accept="image/*" onChange={handleImageUpload} />
                        )}
                    </div>
                    <div style={{ width: '60%', height: '500px' }}>
                        <div className="grid-container">
                            <button onClick={() => handleButtonClick('/model1')} id="model1">Yolo Model 1</button>
                            <button onClick={() => handleButtonClick('/model2')} id="model2">Yolo Model 2</button>
                            <button onClick={() => handleButtonClick('/bw')} id="bw">Black and white</button>
                            <button onClick={() => handleButtonClick('/sharp')} id="sharp">Sharpen</button>
                            <button onClick={() => handleButtonClick('/pause')} id="pause">Pause</button>
                            <button onClick={() => handleButtonClick('/fr')} id="fr">Change frame rate</button>
                        </div>
                    </div>
                </div>
            </div>

            <div id="status">{status}</div>
        </div>
    );
}

export default SensorDemo;
